import styled from "styled-components";

export const HeaderContainer = styled.div`
    height: 70px;
    width: 100%;
    position: fixed;
    border: 1px solid;
    background: #333333;
    display: flex;
    align-items: center;
    justify-content: space-evenly;
    @media(max-width: 767px){
        height: 60px;
        font-size:10px;
    }
    @media(min-width: 768px) and (max-width: 1199px){
        width: 30%;
    }
`
